JFK: The Lost Bullet

History Documentary hosted by Jonathan Booth, published by National Geographic in 2011 - English narration


Information
------------------------------

JFK: The Lost Bullet
It's been called the most important piece of film evidence of all time. Locked away in the vaults of the National Archives, the original Zapruder film that captured the vital 11 seconds of President John F Kennedy's assassination sits tattered and untouchable. Using exclusive eyewitness testimony, as well as newly restored, and in some cases, never-before-seen images of the shooting JFK: The Lost Bullet is a one-off special which investigates the assassination. For nearly 50 years experts have poured over crude copies of this extraordinary film for clues as to what really took place in Dallas on November 22, 1963. The film, in its myriad and often clandestine incarnations, has been presented as conclusive evidence to support just about every conceivable theory of the assassination A team of experts attempts to find the so-called 'lost bullet' fired at John F Kennedy, hoping to finally solve the mystery of his assassination.

